import React from "react";
import Image from "../../assets/Image.png";
import { Box, Typography, Button } from "@mui/material";
import { makeStyles } from "@mui/styles";
// import rightHalf from "../../assets/images/right-2.png";


const useStyle = makeStyles({
  btn: {
    marginTop: "3% !important",
    "@media(min-width: 1390px)": {
      marginTop: "1% !important",
    },
  },
  box: {
    width: "100%",
   
    backgroundImage: `url(${Image})`,
    backgroundSize: "cover",
    backgroundPosition: "center",
  },
  overlay: {
    background: "rgba(0, 0, 0, 0.4)",
    height: "100% !important",
  },
  typography1: {
    display: "flex",
    paddingTop: "0%",
    paddingLeft: "0%",
    fontSize: "20px",
    justifyContent: "left",
    // fontFamily: "Aileron-Regular !important",
    color: "white",
    maxWidth: "50%",
    "@media(max-width: 1000px)": {
      fontSize: "15px !important",
      maxWidth: "70%",
    },
    "@media(min-width: 1000.1px)": {
      fontSize: "15px !important",
      maxWidth: "50%",
    },
    "@media(max-width: 700px)": {
      fontSize: "15px !important",
      maxWidth: "90%",
    },
    "@media(min-width: 1700px)": {
      fontSize: "27px !important",
      maxWidth: "50%",
      // pb: "37px !important",
    },
    "@media(min-width: 1390px)": {
      fontSize: "22px !important",
      justifyContent: "left",
      maxWidth: "50%",
    },
  },
  typography2: {
    display: "flex",
    // fontWeight: 'bold',
    // paddingTop: "8%",
    fontSize: "40px !important",
    paddingLeft: "0%",
    justifyContent: "left",
    color: "white",
    maxWidth: "50%",
    // fontFamily: "Aileron-SemiBold",
    lineHeight: "40px !important",
    "@media(max-width: 1000px)": {
      maxWidth: "100%",
      fontSize: "30px !important",
    },
    "@media(max-width: 700px)": {
      maxWidth: "100%",
      fontSize: "30px !important",
    },
    "@media(max-width: 450px)": {
      maxWidth: "100%",
      fontSize: "30px !important",
      fontWeight: "bold",
    },
    "@media(min-width: 1390px)": {
      fontSize: "40px !important",
      justifyContent: "left",
      maxWidth: "50%",
    },
  },
  buton: {
    width: "200px",
    height: "40px",
    "&:hover": {
      background: "black !important",
      border: "2px solid black !important",
      color: "white !important",
    },
    "@media (max-width: 1300px)": {
      fontSize: "12px !important",
      width: "200px !important",
      height: "40px",
      marginRight: "13px !important",
    },
    "@media (max-width: 800px)": {
      fontSize: "12px !important",
      width: "200px",
      height: "40px",
      marginBottom: "13px !important",
    },
    "@media (max-width: 600px)": {
      fontSize: "12px !important",
      width: "160px !important",
      height: "40px",
    },
  },
});

const BlogPanel = () => {
  const classess = useStyle();
  
  return (
    <>
      <Box
        className={classess.box}
        sx={{
            opacity:0.6,
          position: "relative",
       
          mt: { lg: 10, xs: 6 },
          mb: { lg: 10, xs: 6 },
        }}
      >
        <Box
          className={classess.overlay}
          sx={{
            pb: { xs: 9, sm: 9, lg: 8, xl: 12 },
            pt: { xs: 9, sm: 9, lg: 8, xl: 12 },
          }}
        >
          <Box pl={"6.6%"} pr={"6.6%"}>
            <Typography
              sx={{ pb: { xs: 2, sm: 2, lg: 3 } }}
              className={classess.typography2}
              // vareint="h1"
            >
              what_to <br /> expect_from_us
            </Typography>
            <Typography
              sx={{ pb: { xs: 2, sm: 2, lg: 2 } }}
              className={classess.typography1}
            >
              Lorem ipsum dolor sit amet, consectetur adipiscing elit. Aenean
              vel diam elit. Donec id lectus congue, tempor nunc sit amet,
              ullamcorper orci.
            </Typography>
            <Box className={classess.btn}>
              <Button
                variant="outlined"
                className={classess.buton}
                sx={{
                  borderRadius: "50px !important",
                  color: "black",
                  background: "white",
                  border: "1px solid gray",
                  fontWeight: "bold",
                  // width: { lg: "300px !important", xl: "220px" },
                  height: { lg: "45px" },
                }}
              >
              start_now
              </Button>
            </Box>
          </Box>
        </Box>
        {/* <Box
          component="img"
          src={rightHalf}
          sx={{
            position: "absolute",
            right: 0,
            // top: { lg: 55, md: 600, sm: 700, xs: 900 },
            top: {
              xs: "-170px",
              md: "-140px !important",
              xl: "-160px !important",
              lg: "-160px !important",
            },
          }}
          height={{ xl: 740, lg: 740, md: 650, sm: 400, xs: 350 }}
          width={{ xl: 740, lg: 740, md: 650, sm: 400, xs: 350 }}
          zIndex="-1"
        /> */}
      </Box>
    </>
  );
};

export default BlogPanel;
